import React from 'react';
import {} from 'react-native';
import { Text, View, StyleSheet} from 'react-native'; 

export const Todo = ({todo})=>{
    return(
        <View style = {style.todo}>
            <Text>{todo.title}</Text>
        </View>
    );
};

const style = StyleSheet.create({
    todo: {
        flexDirection: 'row',
        alignItems: 'center',
        padding: 15,
        borderWidth:1,
        borderColor: "#eee",
        borderRadius:5,
        marginBottom:10
    }
});
